    <p>{`Rancher 的应用商店服务要求所有自定义应用商店都必须以特定格式构建，以便应用商店服务能够在 Rancher 中使用它。`}</p>
    <blockquote>
      <p parentName="blockquote">{`有关开发 Chart 的完整步骤，请参阅 Helm Chart `}<a parentName="p" {...{
          "href": "https://helm.sh/docs/chart_template_guide/"
        }}>{`开发人员参考`}</a>{`。`}</p>
    </blockquote>
    <h2 {...{
      "id": "charts-类型"
    }}>{`Charts 类型`}</h2>
    <p>{`Rancher 支持两种不同类型的 Chart：`}</p>
    <ul>
      <li parentName="ul">
        <p parentName="li"><strong parentName="p">{`Helm Chart`}</strong></p>
        <p parentName="li">{`原生 Helm Charts 包括应用程序以及运行它所需的其他软件。部署原生 Helm Chart 时，您将需要了解学习每个 Chart 的参数，然后使用`}<strong parentName="p">{`应答`}</strong>{`（它们是键值对的集合）来配置这些参数。`}</p>
        <p parentName="li">{`Rancher 中的 Helm Stable 和 Helm Incubators 均为原生的 Helm Chart。您也可以添加其他的 Helm Charts（尽管我们建议使用 Rancher Chart）。`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li"><strong parentName="p">{`Rancher Chart`}</strong></p>
        <p parentName="li">{`Rancher Chart 基本与原生 Helm Chart 一样。Rancher Chart 添加了两个额外的文件`}<inlineCode parentName="p">{`app-readme.md`}</inlineCode>{`和`}<inlineCode parentName="p">{`questions.yaml`}</inlineCode>{`来增强用户体验，但它们与原生 Helm Chart 的使用方式完全相同。在 `}<a parentName="p" {...{
            "href": "#rancher-chart-%E7%8B%AC%E6%9C%89%E7%9A%84%E6%96%87%E4%BB%B6"
          }}>{`Rancher Chart 独有的文件`}</a>{`中了解有关它们的更多信息。`}</p>
        <p parentName="li">{`Rancher Charts 的优点包括：`}</p>
        <ul parentName="li">
          <li parentName="ul">
            <p parentName="li"><strong parentName="p">{`增强的修订跟踪`}</strong></p>
            <p parentName="li">{`虽然 Helm 支持版本化的部署，但 Rancher 添加了修订跟踪历史记录，以显示 Charts 的不同版本之间的更改。`}</p>
          </li>
          <li parentName="ul">
            <p parentName="li"><strong parentName="p">{`简化的应用启动流程`}</strong></p>
            <p parentName="li">{`Rancher Chart 添加了简化的 Chart 说明和配置表单，以简化应用商店中应用的部署。Rancher 用户无需阅读整个 Helm Chart 变量的列表即可了解如何启动应用。`}</p>
          </li>
          <li parentName="ul">
            <p parentName="li"><strong parentName="p">{`应用资源管理`}</strong></p>
            <p parentName="li">{`Rancher 将跟踪由特定应用创建的所有资源。用户可以轻松地在 UI 上进行故障排查，该页面列出了此应用的所有工作负载和其他相关对象。`}</p>
          </li>
        </ul>
      </li>
    </ul>
    <h2 {...{
      "id": "应用商店的文件结构"
    }}>{`应用商店的文件结构`}</h2>
    <p>{`下表为应用商店 Chart 的结构，展示了`}<inlineCode parentName="p">{`charts/<APPLICATION>/<APP_VERSION>/`}</inlineCode>{`目录下的结构。在为自定义应用商店定制 Chart 时，此信息很有用。带有 `}<strong parentName="p">{`*`}</strong>{` 的文件代表 Rancher Chart 独有的文件，但这些文件不是必须的。`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`charts/<APPLICATION>/<APP_VERSION>/
| --charts /            # 包含依赖的 Chart 的应用商店。
| --templates/          # 包含应用商店的模板，当与 values.yml 结合使用时，将生成 Kubernetes YAML。
| --app-readme.md       # 文本为显示在 Rancher UI 的 Chart 标题中。*
| --Chart.yml           # 必需的 Helm Chart 信息文件。
| --questions.yml       # 用于生成在 Rancher UI 中显示的应答表单。它们将显示在配置选项中。*
| --README.md           # 可选：在 Rancher UI 中显示的 Helm 自述文件。该文本显示在“详细描述”中。
| --requirements.yml    # 可选：YAML 文件列出了 Chart 的依赖关系。
| --values.yml          # Chart 的默认配置值。
`}</code></pre>
    <h2 {...{
      "id": "rancher-chart-独有的文件"
    }}>{`Rancher Chart 独有的文件`}</h2>
    <p>{`在创建自己的自定义应用商店之前，您应该对 Rancher Chart 与本地 Helm Chart 的区别有基本的了解。Rancher Chart 的应用商店结构与 Helm Chart 略有不同。Rancher Chart 包含了两个 Helm Chart 不包含的文件。`}</p>
    <ul>
      <li parentName="ul">
        <p parentName="li"><inlineCode parentName="p">{`app-readme.md`}</inlineCode></p>
        <p parentName="li">{`在 Chart 的 UI 标题中提供描述性文本的文件。下图显示了 Rancher Chart（包括`}<inlineCode parentName="p">{`app-readme.md`}</inlineCode>{`）和原生 Helm Chart（不包括`}<inlineCode parentName="p">{`app-readme.md`}</inlineCode>{`）之间的差异。`}</p>
 <figcaption>带有 “app-readme.md” 的 Rancher Chart(左)与没有“app-readme.md”的 Helm Chart(右)</figcaption>
        <p parentName="li"><img parentName="p" {...{
            "src": "/img/rancher/app-readme.png",
            "alt": "app-readme.md"
          }}></img></p>
      </li>
      <li parentName="ul">
        <p parentName="li"><inlineCode parentName="p">{`questions.yml`}</inlineCode></p>
        <p parentName="li">{`包含 Chart 问题的文件。这些问题简化了 Chart 的部署。没有它，您必须使用键值对配置部署。下图显示了 Rancher Chart（包括`}<inlineCode parentName="p">{`questions.yml`}</inlineCode>{`）和原生 Helm Chart（不包括`}<inlineCode parentName="p">{`questions.yml`}</inlineCode>{`）之间的差异。`}</p>
